import React from "react";
import { ReactComponent as HomeIcon } from "../assets-esnek-mini/buttons/home.svg";
import { ReactComponent as AboutIcon } from "../assets-esnek-mini/buttons/about.svg";
import { ReactComponent as ServicesIcon } from "../assets-esnek-mini/buttons/services.svg";
import { ReactComponent as PortfolioIcon } from "../assets-esnek-mini/buttons/portfolio.svg";
import { ReactComponent as BlogIcon } from "../assets-esnek-mini/buttons/blog.svg";
import { ReactComponent as ContactIcon } from "../assets-esnek-mini/buttons/contact.svg";

export default function Menu() {
  return (
    <div className="menu">
      <div className="menu-item">
        <HomeIcon />
        <span>Home</span>
      </div>
      <div className="menu-item">
        <AboutIcon />
        <span>About</span>
      </div>
      <div className="menu-item">
        <ServicesIcon />
        <span>Services</span>
      </div>
      <div className="menu-item">
        <PortfolioIcon />
        <span>Portfolio</span>
      </div>
      <div className="menu-item">
        <BlogIcon />
        <span>Blog</span>
      </div>
      <div className="menu-item">
        <ContactIcon />
        <span>Contact</span>
      </div>
    </div>
  );
}
